import AdminSideMenu from '../AdminSideMenu/AdminSideMenu';

export const AdminAllUsers = () => {
  return (
    <div className="admin-all-users">
      <h1>THREADYOL</h1>
      <div className="sidebar">
        <AdminSideMenu />
      </div>
    </div>
  );
};

export default AdminAllUsers;
